lor de consimțământ</span> <button class="cky-btn-close" aria-label="Închide" data-cky-tag="detail-close"> <img src="https://cdn-cookieyes.com/assets/images/close.svg" alt="Close"> </button> </div> <div class="cky-preference-body-wrapper"> <div class="cky-preference-content-wrapper" data-cky-tag="detail-description" style="color: #212121;"><p>Folosim cookie-uri pentru a vă ajuta să navigați cu eficiență și să utilizați anumite funcții. Veți găsi informații detaliate privind cookie-urile în cadrul fiecăreia dintre categoriile de consimțământ de mai jos.</p><p>Cookie-urile care sunt considerate „Necesare” sunt stocate în browserul dvs., deoarece sunt esențiale pentru a permite buna funcționare a unor funcții de bază ale site-ului. ...&nbsp;<button class="cky-show-desc-btn" data-cky-tag="show-desc-button" aria-label="Afișează mai mult">Afișează mai mult</button></p></div>  <div class="cky-horizontal-separator"></div> <div class="cky-accordion-wrapper" data-cky-tag="detail-categories"> <div class="cky-accordion" id="ckyDetailCategorynecessary"><div class="cky-accordion-item"><div class="cky-accordion-chevron"><i class="cky-chevron-right"></i></div><div class="cky-accordion-header-wrapper"><div class="cky-accordion-header"><button class="cky-accordion-btn" aria-expanded="false" aria-label="Necesare" data-cky-tag="detail-category-title" style="color: #212121;">Necesare</button><span class="cky-always-active">Întotdeauna activ</span></div><div class="cky-accordion-header-des" data-cky-tag="detail-category-description" style="color: #212121;"><p>Cookie-urile necesare sunt esențiale pentru funcțiile de bază ale site-ului web, iar site-ul web nu va funcționa în modul dorit fără ele.Aceste cookie-uri nu stochează date de identificare personală.</p></div></div></div><div class="cky-accordion-body"><div class="cky-audit-table" data-cky-tag="audit-table" style="color: #212121; border-color: #ebebeb; background-color: #f4f4f4;"><ul class="cky-cookie-des-table"><li><div>Cookie-uri</div><div>cookieyes-consent</div></li><li><div>Durată</div><div>1 an</div></li><li><div>Descriere</div><div>CookieYes setează acest cookie pentru a stoca preferințele de consimțământ ale utilizatorului, astfel încât preferințele lor să fie respectate pentru vizitele viitoare pe acest site. Nu colectează sau stochează informații personale cu privire la vizitatorii site-uli.</div></li></ul><ul class="cky-cookie-des-table"><li><div>Cookie-uri</div><div>PHPSESSID</div></li><li><div>Durată</div><div>3 luni</div></li><li><div>Descriere</div><div>Acest cookie este nativ pentru aplicațiile în PHP. Acest cookie stochează și identifică ID-ul unic de sesiune al utilizatorului, cu scopul de a gestiona sesiunile utilizatorului pe website. Acest cookie este un cookie temporar și va fi șters la închiderea tuturor ferestrelor browserului.</div></li></ul></div></div></div><div class="cky-accordion" id="ckyDetailCategoryfunctional"><div class="cky-accordion-item"><div class="cky-accordion-chevron"><i class="cky-chevron-right"></i></div><div class="cky-accordion-header-wrapper"><div class="cky-accordion-header"><button class="cky-accordion-btn" aria-expanded="false" aria-label="Funcţionalitate" data-cky-tag="detail-category-title" style="color: #212121;">Funcţionalitate</button><div class="cky-switch" data-cky-tag="detail-category-toggle"><input type="checkbox" id="ckySwitchfunctional" aria-label="Dezactivați Funcţionalitate" style="background-color: rgb(225, 189, 6);"></div></div><div class="cky-accordion-header-des" data-cky-tag="detail-category-description" style="color: #212121;"><p>Cookie-urile de funcționalitate ajută la realizarea anumitor funcționalități, cum ar fi partajarea conținutului site-ului web pe platformele de socializare, colectarea de feedback și alte caracteristici ale terților.</p></div></div></div><div class="cky-accordion-body"><div class="cky-audit-table" data-cky-tag="audit-table" style="color: #212121; border-color: #ebebeb; background-color: #f4f4f4;"><ul class="cky-cookie-des-table"><li><div>Cookie-uri</div><div>mailchimp_landing_site</div></li><li><div>Durată</div><div>1 lună</div></li><li><div>Descriere</div><div>MailChimp setează cookie-ul pentru a înregistra care a fost prima pagină vizitată de către utilizator.</div></li></ul></div></div></div><div class="cky-accordion" id="ckyDetailCategoryanalytics"><div class="cky-accordion-item"><div class="cky-accordion-chevron"><i class="cky-chevron-right"></i></div><div class="cky-accordion-header-wrapper"><div class="cky-accordion-header"><button class="cky-accordion-btn" aria-expanded="false" aria-label="Analitice" data-cky-tag="detail-category-title" style="color: #212121;">Analitice</button><div class="cky-switch" data-cky-tag="detail-category-toggle"><input type="checkbox" id="ckySwitchanalytics" aria-label="Dezactivați Analitice" style="background-color: rgb(225, 189, 6);"></div></div><div class="cky-accordion-header-des" data-cky-tag="detail-category-description" style="color: #212121;"><p>Cookie-urile analitice sunt utilizate pentru a înțelege modul în care vizitatorii interacționează cu site-ul web. Aceste cookie-uri ajută la furnizarea de informații cu privire la valori, cum ar fi numărul de vizitatori, rata de respingere, sursa de trafic etc.</p></div></div></div><div class="cky-accordion-body"><div class="cky-audit-table" data-cky-tag="audit-table" style="color: #212121; border-color: #ebebeb; background-color: #f4f4f4;"><ul class="cky-cookie-des-table"><li><div>Cookie-uri</div><div>_ga_*</div></li><li><div>Durată</div><div>1 an 1 lună 4 zile</div></li><li><div>Descriere</div><div>Google Analytics sets this cookie to store and count page views.</div></li></ul><ul class="cky-cookie-des-table"><li><div>Cookie-uri</div><div>_ga</div></li><li><div>Durată</div><div>1 an 1 lună 4 zile</div></li><li><div>Descriere</div><div>Google Analytics setează acest cookie pentru a calcula datele pentru vizitatori, sesiune și campanie și pentru a urmări utilizarea site-ului pentru raportul de analiză statistică. Cookie-ul stochează informație în mod anonim și atribuie un număr generat aleatoriu pentru a recunoaște vizitatorii unici.</div></li></ul><ul class="cky-cookie-des-table"><li><div>Cookie-uri</div><div>_fbp</div></li><li><div>Durată</div><div>7 zile</div></li><li><div>Descriere</div><div>Facebook setează acest cookie pentru a afișa reclame când, după ce a vizitat acest site, utilizatorul accesează Facebook sau o platformă digitală care folosește platforma de publicitate Facebook.</div></li></ul><ul class="cky-cookie-des-table"><li><div>Cookie-uri</div><div>pys_session_limit</div></li><li><div>Durată</div><div>1 oră</div></li><li><div>Descriere</div><div>PixelYourSite plugin sets this cookie to manage the analytical services.</div></li></ul><ul class="cky-cookie-des-table"><li><div>Cookie-uri</div><div>pys_start_session</div></li><li><div>Durată</div><div>sesiune</div></li><li><div>Descriere</div><div>PixelYourSite plugin sets this cookie to manage the analytical services.</div></li></ul><ul class="cky-cookie-des-table"><li><div>Cookie-uri</div><div>pys_first_visit</div></li><li><div>Durată</div><div>7 zile</div></li><li><div>Descriere</div><div>PixelYourSite plugin sets this cookie to manage the analytical services.</div></li></ul><ul class="cky-cookie-des-table"><li><div>Cookie-uri</div><div>pysTrafficSource</div></li><li><div>Durată</div><div>7 zile</div></li><li><div>Descriere</div><div>PixelYourSite plugin sets this cookie to manage the analytical services.</div></li></ul><ul class="cky-cookie-des-table"><li><div>Cookie-uri</div><div>pys_landing_page</div></li><li><div>Durată</div><div>7 zile</div></li><li><div>Descriere</div><div>PixelYourSite plugin sets this cookie to manages the analytical services.</div></li></ul><ul class="cky-cookie-des-table"><li><div>Cookie-uri</div><div>last_pysTrafficSource</div></li><li><div>Durată</div><div>7 zile</div></li><li><div>Descriere</div><div>PixelYourSite plugin sets this cookie to manage the analytical services.</div></li></ul><ul class="cky-cookie-des-table"><li><div>Cookie-uri</div><div>last_pys_landing_page</div></li><li><div>Durată</div><div>7 zile</div></li><li><div>Descriere</div><div>PixelYourSite plugin sets this cookie to manages the analytical services.</div></li></ul><ul class="cky-cookie-des-table"><li><div>Cookie-uri</div><div>_hjSessionUser_*</div></li><li><div>Durată</div><div>1 an</div></li><li><div>Descriere</div><div>Hotjar sets this cookie to ensure data from subsequent visits to the same site is attributed to the same user ID, which persists in the Hotjar User ID, which is unique to that site.</div></li></ul><ul class="cky-cookie-des-table"><li><div>Cookie-uri</div><div>_hjSession_*</div></li><li><div>Durată</div><div>1 oră</div></li><li><div>Descriere</div><div>Hotjar sets this cookie to ensure data from subsequent visits to the same site is attributed to the same user ID, which persists in the Hotjar User ID, which is unique to that site.</div></li></ul><ul class="cky-cookie-des-table"><li><div>Cookie-uri</div><div>_hjTLDTest</div></li><li><div>Durată</div><div>sesiune</div></li><li><div>Descriere</div><div>To determine the most generic cookie path that has to be used instead of the page hostname, Hotjar sets the _hjTLDTest cookie to store different URL substring alternatives until it fails.</div></li></ul></div></div></div><div class="cky-accordion" id="ckyDetailCategoryperformance"><div class="cky-accordion-item"><div class="cky-accordion-chevron"><i class="cky-chevron-right"></i></div><div class="cky-accordion-header-wrapper"><div class="cky-accordion-header"><button class="cky-accordion-btn" aria-expanded="false" aria-label="Performanţă" data-cky-tag="detail-category-title" style="color: #212121;">Performanţă</button></div><div class="cky-accordion-header-des" data-cky-tag="detail-category-description" style="color: #212121;"><p>Cookie-urile de performanță sunt utilizate pentru a înțelege și analiza indicii cheie de performanță al site-ului web, ceea ce ajută la oferirea unei experiențe de utilizare mai bună pentru vizitatori.</p></div></div></div><div class="cky-accordion-body"><div class="cky-audit-table" data-cky-tag="audit-table" style="color: #212121; border-color: #ebebeb; background-color: #f4f4f4;"><p class="cky-empty-cookies-text">Nu există cookie-uri de afișat.</p></div></div></div><div class="cky-accordion" id="ckyDetailCategoryadvertisement"><div class="cky-accordion-item"><div class="cky-accordion-chevron"><i class="cky-chevron-right"></i></div><div class="cky-accordion-header-wrapper"><div class="cky-accordion-header"><button class="cky-accordion-btn" aria-expanded="false" aria-label="Publicitate" data-cky-tag="detail-category-title" style="color: #212121;">Publicitate</button><div class="cky-switch" data-cky-tag="detail-category-toggle"><input type="checkbox" id="ckySwitchadvertisement" aria-label="Dezactivați Publicitate" style="background-color: rgb(225, 189, 6);"></div></div><div class="cky-accordion-header-des" data-cky-tag="detail-category-description" style="color: #212121;"><p>Cookie-urile publicitare sunt utilizate pentru a oferi vizitatorilor reclame personalizate pe baza paginilor pe care le-au vizitat anterior și pentru a analiza eficiența campaniei publicitare.</p></div></div></div><div class="cky-accordion-body"><div class="cky-audit-table" data-cky-tag="audit-table" style="color: #212121; border-color: #ebebeb; background-color: #f4f4f4;"><ul class="cky-cookie-des-table"><li><div>Cookie-uri</div><div>_ttp</div></li><li><div>Durată</div><div>1 an 24 zile</div></li><li><div>Descriere</div><div>TikTok set this cookie to track and improve the performance of advertising campaigns, as well as to personalise the user experience.</div></li></ul><ul class="cky-cookie-des-table"><li><div>Cookie-uri</div><div>_tt_enable_cookie</div></li><li><div>Durată</div><div>1 an 24 zile</div></li><li><div>Descriere</div><div>Tiktok set this cookie to collect data about behaviour and activities on the website and to measure the effectiveness of the advertising.</div></li></ul><ul class="cky-cookie-des-table"><li><div>Cookie-uri</div><div>fr</div></li><li><div>Durată</div><div>3 luni</div></li><li><div>Descriere</div><div>Facebook setează acest cookie pentru a putea afișa publicitate relevantă, urmăring comportamentul utilizatorului pe web, pe site-ul cu un pixel Facebook sau cu un plugin social Facebook.</div></li></ul></div></div></div><div class="cky-accordion" id="ckyDetailCategoryother"><div class="cky-accordion-item"><div class="cky-accordion-chevron"><i class="cky-chevron-right"></i></div><div class="cky-accordion-header-wrapper"><div class="cky-accordion-header"><button class="cky-accordion-btn" aria-expanded="false" aria-label="Necategorizat" data-cky-tag="detail-category-title" style="color: #212121;">Necategorizat</button><div class="cky-switch" data-cky-tag="detail-category-toggle"><input type="checkbox" id="ckySwitchother" aria-label="Dezactivați Necategorizat" style="background-color: rgb(225, 189, 6);"></div></div><div class="cky-accordion-header-des" data-cky-tag="detail-category-description" style="color: #212121;"><p>Alte cookie-uri necategorizate sunt cele care sunt analizate și nu au fost încă clasificate într-o categorie încă.</p></div></div></div><div class="cky-accordion-body"><div class="cky-audit-table" data-cky-tag="audit-table" style="color: #212121; border-color: #ebebeb; background-color: #f4f4f4;"><ul class="cky-cookie-des-table"><li><div>Cookie-uri</div><div>pbid</div></li><li><div>Durată</div><div>6 luni</div></li><li><div>Descriere</div><div>Description is currently not available.</div></li></ul><ul class="cky-cookie-des-table"><li><div>Cookie-uri</div><div>cookies.js</div></li><li><div>Durată</div><div>sesiune</div></li><li><div>Descriere</div><div>No description available.</div></li></ul></div></div></div> </div> </div> </div>  <div class="cky-footer-wrapper"> <span class="cky-footer-shadow" style="background: linear-gradient(180deg, rgba(255, 255, 255, 0) 0%, #FFFFFF 100%);"></span> <div class="cky-prefrence-btn-wrapper" data-cky-tag="detail-buttons"> <button class="cky-btn cky-btn-accept" aria-label="Acceptare toate" data-cky-tag="detail-accept-button" style="color: #FFFFFF; border-color: rgb(225, 189, 6); background-color: rgb(225, 189, 6);"> Acceptare toate </button> <button class="cky-btn cky-btn-preferences" aria-label="Salvați preferințele mele" data-cky-tag="detail-save-button" style="color: rgb(225, 189, 6); border-color: rgb(225, 189, 6); background-color: transparent;"> Salvați preferințele mele </button> <button class="cky-btn cky-btn-reject" aria-label="Refuzare toate" data-cky-tag="detail-reject-button" style="color: rgb(225, 189, 6); border-color: rgb(225, 189, 6); background-color: transparent;"> Refuzare toate </button> </div> <div style="padding: 8px 24px; font-size: 12px; font-weight: 400; line-height: 20px; text-align: right; direction: ltr; display: flex; justify-content: flex-end; align-items: center; color: #293C5B; background-color: #EDEDED;" data-cky-tag="detail-powered-by"> Powered by <a target="_blank" rel="noopener" href="https://www.cookieyes.com/product/cookie-consent" style="margin-left: 5px; line-height: 0"><img src="https://cdn-cookieyes.com/assets/images/poweredbtcky.svg" alt="Cookieyes logo" style="width: 78px; height: 13px; margin: 0"></a> </div> </div> </div> </div> </div>
